import {Link} from "react-router-dom"
import { useEffect, useState } from "react";
import { useRef } from "react";

export default function Navbar(){
    const inputRef = useRef(0);
    let [x_screen,setX_screen] = useState(0) ;
    useEffect(() => {
        setX_html(inputRef.current.getBoundingClientRect().width)
        setX_screen(window.screen.availHeight)
        
    }, [])

    if (x_screen.width < 700){
        console.log("lbozo")
    }
    return(
        <nav className='navbar text-purple-400 font-high flex bg-black sticky top-0'>
            <ul>
                <li>
                    <Link className="mx-4 text-center px-4 py-4 rounded-xl hover:bg-emerald-400 duration-300 hover:text-black" to="/">Home</Link>
                </li >
                <li>
                    <Link className="mx-4 text-center px-4 py-4 rounded-xl hover:bg-emerald-400 duration-300 hover:text-black " to="/about">About me</Link>
                </li>
                <li>
                    <a href="https://discord.gg/gyfCYxxQep" target="_blank" className="mx-4 text-center px-4 py-4 rounded-xl hover:bg-emerald-400 duration-300 hover:text-black" rel="noreferrer">Discord</a>
                </li>
                <li>
                    <a href="https://github.com/Immortal-youtube" target="_blank" className="mx-4 text-center px-4 py-4 rounded-xl hover:bg-emerald-400 duration-300 hover:text-black" rel="noreferrer">Github</a>
                </li>
                <li>
                    <a href="https://www.youtube.com/channel/UCgppWM8JtpTfEYp8sa8XHEw" target="_blank" className="mx-4 text-center px-4 py-4 rounded-xl hover:bg-emerald-400 duration-300 hover:text-black" rel="noreferrer">Youtube</a>
                </li>
            </ul>
        </nav>
    );
}
